var evolve = evolves[size][topology];
var pattern;

function gPattern(){
	return location.hash ? parseInt(location.hash.substring(1), 10) : "";
}

function changePattern(){
	location = "#" + document.getElementById("pattern-input").value;
	initialize();
	return false;
}

function runPattern(){
	console.log(pattern);
	showPattern(pattern);
	pattern = evolve(pattern);
	setTimeout(runPattern, 1000);
}

function gTd(x, y){
	return "<td><div id=\"cell"+y+x+"\"></div></td>";
}

function gTr(y){
	var ret = "<tr>";
	for(var x=0; x<size; x++)
		ret+= gTd(x, y);
	ret+= "</tr>";
	return ret;
}

function gBoard(){
	var ret = "";
	for(var y=0; y<size; y++)
		ret+= gTr(y);
	return ret;
}

function showPattern(pattern){
	for(var i=0; i<size*size; i++){
		x = i%size;
		y = Math.floor(i/size);
		document.getElementById("cell"+y+x).className = pattern%2 ? "alive" : "dead";
		if(pattern%2) 
			$("#cell"+y+x).fadeIn(1000, "swing");
		else
			$("#cell"+y+x).fadeOut(1000, "swing");
		pattern = Math.floor(pattern/2);
	}
}

function initialize(){
	document.getElementById("pattern-input").form.onsubmit = changePattern;
	document.getElementById("board").innerHTML = gBoard();
	
	pattern = gPattern();
	document.getElementById("pattern-input").value = pattern;
	
	$(window).bind('hashchange', initialize);
}

initialize();
runPattern();

